import "animate.css/animate.min.css";
import { ConfigProvider } from "antd";
import TodoMain from "pages/ui/TodoMain";

function App() {
    return (
        <ConfigProvider
            theme={{
                algorithm:
                    themeType === "dark"
                        ? theme.darkAlgorithm
                        : theme.defaultAlgorithm,
                token: { colorPrimary: "rgb(184, 178, 178)" },
                components: { Button: { colorBorder: "red" } },
            }}
        >
            <div className="App">
                <TodoMain />
            </div>
        </ConfigProvider>
    );
}

export default App;
